.EQU SPECIAL_ASTEROID_CHANCE, 0x20000000

// let ship: &mut Ship;
.align 2
ship:
	.word 1
	.word 160 * 8, 120 * 8
	.hword 0, 0
	.hword 100, 100, 12 * 8, 50, 8 * 8
	.byte 0, 30, 0

/*
struct CostumedEntity extends Entity {
	costume: &Pixmap,
}
*/
.EQU COSTUMEDENTITY_FIELD_COSTUME, ENTITY_SIZE
.EQU COSTUMEDENTITY_SIZE, ENTITY_SIZE + 4

