/*
struct Animation extends Entity {
	frames: &[Pixmap],
}
// frames is a pointer to an array of Pixmap pointers. Every frame, this pointer is advanced to
// point to the next &Pixmap. The lifetime of the Animation dictates how many frames are left to show.
*/
.EQU ANIMATION_FIELD_FRAMES, ENTITY_SIZE
.EQU ANIMATION_SIZE, ENTITY_SIZE + 4

/*
struct Csb<T> {
	elementSize: u32,
	capacity: u32,
	begin: u32,
	end: u32,
	data: [T; capacity], // variable length array
}
// Csb stands for "circular sparse buffer." The buffer is circular; an iterator that is incremented to
// equal the capacity will wrap around to the beginning of the array. The "sparse" comes from the
// fact that during iteration, some elements are skipped (considered "dead") depending on if first
// word is 0. Therefore, T must be a type with at least size 4.
// Because of how the circular buffer works, the actual capacity is buff.capacity - 1.
// A full-capacity buffer would have the begin and end iterators at the same position, but that
// would actually indicate an empty buffer.
*/
.EQU CSB_FIELD_ELEMENTSIZE, 0
.EQU CSB_FIELD_CAPACITY, 4
.EQU CSB_FIELD_BEGIN, 8
.EQU CSB_FIELD_END, 12
.EQU CSB_FIELD_DATA, 16

// let mut bulletBuff: &Csb<Bullet>;
.align 2
bulletBuff:
	.word BULLET_SIZE
	.word 64
	.word 0
	.word 0
	.skip 64 * BULLET_SIZE

// let mut asteroidBuff: &Csb<Asteroid>;
.align 2
asteroidBuff:
	.word ASTEROID_SIZE
	.word 32
	.word 0
	.word 0
	.skip 32 * ASTEROID_SIZE

// let mut itemBuff: &Csb<Item>;
.align 2
itemBuff:
	.word ITEM_SIZE
	.word 64
	.word 0
	.word 0
	.skip 64 * ITEM_SIZE

// let mut animationBuff: &Csb<Animation>;
.align 2
animationBuff:
	.word ANIMATION_SIZE
	.word 16
	.word 0
	.word 0
	.skip 16 * ANIMATION_SIZE

// let mut mineralBank: u32 = 0;
.align 2
mineralBank:
	.word 0

// let mut tick: u32 = 0;
.align 2
tick:
	.word 0

// let mut scores: (u32, u32) = (0, 0); // (score, highScore)
.align 2
scores:
	.word 0
	.word 0

/*
struct DifficultyEntry {
	baseCometCountdown: i32, // positive only
	baseAsteroidCountdown: i32, // positive only
	largeAsteroidChance: u32, // will spawn a large asteroid if the rng generates a u32 smaller than
	medAsteroidChance: u32, // will spawn a med asteroid if rng generates u32 smaller than this but larger than largeAsteroidChance
	rangeXVel: i16, // magnitude of xVel will not exceed this, positive only
	baseYVel: i16 // positive only
	baseAsteroidHealth: i16, // positive only
}
*/
.EQU DIFFICULTYENTRY_FIELD_BASECOMETCOUNTDOWN, 0
.EQU DIFFICULTYENTRY_FIELD_BASEASTEROIDCOUNTDOWN, 4
.EQU DIFFICULTYENTRY_FIELD_LARGEASTEROIDCHANCE, 8
.EQU DIFFICULTYENTRY_FIELD_MEDASTEROIDCHANCE, 12
.EQU DIFFICULTYENTRY_FIELD_RANGEXVEL, 16
.EQU DIFFICULTYENTRY_FIELD_BASEYVEL, 18
.EQU DIFFICULTYENTRY_FIELD_BASEASTEROIDHEALTH, 20
.EQU DIFFICULTYENTRY_SIZE, 24 // add padding

// let difficultyTable: &[DifficultyEntry; 10];
.align 2
difficultyTable:
	.word 500, 50, 0x08000000 * 0, 0x08000000 * 0
	.hword 8, 8, 3
	.skip 2
	.word 490, 45, 0x08000000 * 0, 0x08000000 * 1
	.hword 9, 9, 4
	.skip 2
	.word 480, 41, 0x08000000 * 0, 0x08000000 * 2
	.hword 10, 10, 5
	.skip 2
	.word 470, 37, 0x08000000 * 0, 0x08000000 * 3
	.hword 11, 11, 6
	.skip 2
	.word 460, 33, 0x08000000 * 0, 0x08000000 * 4
	.hword 12, 12, 7
	.skip 2
	.word 450, 30, 0x08000000 * 0, 0x08000000 * 5
	.hword 13, 13, 8
	.skip 2
	.word 440, 27, 0x08000000 * 0, 0x08000000 * 6
	.hword 14, 14, 9
	.skip 2
	.word 430, 24, 0x08000000 * 0, 0x08000000 * 7
	.hword 15, 15, 10
	.skip 2
	.word 420, 22, 0x08000000 * 0, 0x08000000 * 8
	.hword 16, 16, 11
	.skip 2
	.word 410, 20, 0x08000000 * 0, 0x08000000 * 9
	.hword 17, 17, 12
	.skip 2
	.word 400, 18, 0x08000000 * 0, 0x08000000 * 10
	.hword 18, 18, 13
	.skip 2

	.word 390, 17, 0x08000000 * 1, 0x08000000 * 10
	.hword 18, 18, 14
	.skip 2
	.word 380, 17, 0x08000000 * 2, 0x08000000 * 10
	.hword 19, 19, 15
	.skip 2
	.word 370, 16, 0x08000000 * 3, 0x08000000 * 10
	.hword 20, 20, 16
	.skip 2
	.word 360, 16, 0x08000000 * 4, 0x08000000 * 10
	.hword 21, 21, 17
	.skip 2
	.word 350, 15, 0x08000000 * 5, 0x08000000 * 10
	.hword 22, 22, 18
	.skip 2
	.word 340, 15, 0x08000000 * 6, 0x08000000 * 10
	.hword 23, 23, 19
	.skip 2
	.word 330, 15, 0x08000000 * 7, 0x08000000 * 11
	.hword 24, 24, 20
	.skip 2
	.word 320, 14, 0x08000000 * 8, 0x08000000 * 12
	.hword 25, 25, 21
	.skip 2
	.word 310, 14, 0x08000000 * 9, 0x08000000 * 13
	.hword 26, 26, 22
	.skip 2
	.word 300, 14, 0x08000000 * 10, 0x08000000 * 14
	.hword 27, 27, 23
	.skip 2
	.word 290, 14, 0x08000000 * 11, 0x08000000 * 15
	.hword 28, 28, 24
	.skip 2
