	.skip 2
	// TODO add more entries

.align 2
// let difficulty = &DifficultyEntry;
difficulty:
	.word difficultyTable

/*
enum GameState {
	StartScreen,
	InGame,
	Paused,
	DeathScreen,
} // underlying type u8
*/
.EQU GAMESTATE_VARIANT_DEATHSCREEN, 0
.EQU GAMESTATE_VARIANT_STARTSCREEN, 1
.EQU GAMESTATE_VARIANT_INGAME, 2
.EQU GAMESTATE_VARIANT_PAUSED, 3

// let mut gameState: &GameState = GameState::StartScreen;
gameState:
	.byte GAMESTATE_VARIANT_STARTSCREEN

.text
// functions here ==================================================================================

/*
fn _start();
*/
.global _start
_start:
	// initialize stack pointer
	mov sp, #0x800000

	bl setUpDoubleBuffer

	// call main
	bl main

	// idk what to do if execution gets here so just do a useless loop
_start_uselessLoop:
	ror r0, r0, #1
	b _start_uselessLoop
// end _start

/*
fn main();
*/
main:
	push {r4, r5, lr}

	ldr r4, =REG_PIX_BACKBUFFER

main_loop:
	bl updateKeyboardState

	bl advanceFrame

	// render frame
	bl waitVsync
	ldr r0, [r4]
	bl renderFrame
	bl swapBuffers

	b main_loop

	pop {r4, r5, lr}
// end main

/*
advanceFrame: changes the game state to reflect the next frame

fn advanceFrame() {
	processPlayerInput();
	moveEntities();
	processCollisions();
	trimCsb(bulletBuff);
	trimCsb(asteroidBuff);
	trimCsb(itemBuff);
	trimCsb(animationBuff);

	if gameState == GameState::InGame {
		asteroidSpawner();
		cometSpawner();
		tick += 1;
		if tick % 1024 == 0 {
			difficulty = difficulty + DifficultyEntry::size;
		}
	}
}
*/
advanceFrame:
	push {r4-r6, lr}

	bl processPlayerInput

	bl moveEntities

	bl processCollisions

	ldr r0, =bulletBuff
	bl trimCsb
	ldr r0, =asteroidBuff
	bl trimCsb
	ldr r0, =itemBuff
	bl trimCsb
	ldr r0, =animationBuff
	bl trimCsb

	ldr r0, =gameState
	ldrb r0, [r0]
	cmp r0, #GAMESTATE_VARIANT_INGAME
	bne advanceFrame_noTick

	bl asteroidSpawner
	bl cometSpawner

	// r1 = tick
	ldr r0, =tick
	ldr r1, [r0]
	add r1, r1, #1
	str r1, [r0]

	// r1 = ???
	lsls r2, r1, #22 // leave only the last 10 bits to test
	bne advanceFrame_noIncreaseDifficulty
	ldr r0, =difficulty
	ldr r1, [r0]
	add r1, r1, #DIFFICULTYENTRY_SIZE
	str r1, [r0]
advanceFrame_noIncreaseDifficulty:

advanceFrame_noTick:

	pop {r4-r6, pc}
// end advanceFrame

/*
asteroidSpawner: either counts down a timer for the next asteroid spawn, or if the timer has just
run out, spawns an asteroid and sets up the next spawn

fn asteroidSpawner() {
	let static mut countdown = 1;

	countdown -= 1;
	if countdown > 0 {
		return;
	}

	countdown = difficulty.baseAsteroidCountdown * (1 + (rand() as fixpt32_32) / 4);

	let asteroid = addSpace(asteroidBuff);
	asteroid.lifetime = 512;
	asteroid.originalHealth = difficulty.baseAsteroidHealth * (1 + (rand() as fixpt32_32) / 4);
	asteroid.health = asteroid.originalHealth;
	asteroid.size = match rand() {
		0..difficulty.largeAsteroidChance => 8,
		0..difficulty.medAsteroidChance => 7,
		_ => 6,
	};
	asteroid.isSpecial = rand() < SPECIAL_ASTEROID_CHANCE;
	asteroid.costume = getAsteroidSkin(asteroid.size, asteroid.isSpecial);
	asteroid.yVel = difficulty.baseYVel * (1 + (rand() as fixpt32_32) / 4);
	asteroid.yPos = -32 * 8;
	let xVelScale = rand() as fixpt32_32;
	asteroid.xVel = difficulty.rangeXVel * xVelScale * if (xVelScale as u32) & 0x80000000 { -1 } else { 1 };
	asteroid.xPos = (PIX_WIDTH * 8) * (rand() as fixpt32_32) + asteroid.xVel * 512;
}
*/
asteroidSpawner_countdown:
	.word 1
asteroidSpawner:
	ldr r0, asteroidSpawner_countdown
	subs r0, r0, #1
	str r0, asteroidSpawner_countdown
	bxgt lr

	push {r4-r6, lr}

	// r4 = difficulty
	ldr r4, =difficulty
	ldr r4, [r4]

	bl rand // r0 = rand() as fixpt32_32
	ldr r1, [r4, #DIFFICULTYENTRY_FIELD_BASEASTEROIDCOUNTDOWN] // r1 = baseAsteroidCountdown
	asr r2, r1, #2 // r2 = baseAsteroidCountdown / 4
	umull r2, r3, r0, r2 // umull in order to treat r0 as a fixed point value
	add r1, r1, r3
	str r1, asteroidSpawner_countdown

	// r5 = asteroid
	ldr r0, =asteroidBuff
	bl addSpace
	mov r5, r0

	mov r0, #512
	str r0, [r5, #ENTITY_FIELD_LIFETIME]

	bl rand
	ldrsh r1, [r4, #DIFFICULTYENTRY_FIELD_BASEASTEROIDHEALTH]
	asr r2, r1, #2
	umull r2, r3, r0, r2 // okay because r2 is only ever going to be positive
	add r1, r1, r3
	strh r1, [r5, #ASTEROID_FIELD_HEALTH]
	strh r1, [r5, #ASTEROID_FIELD_ORIGINALHEALTH]

	// r0 = asteroid.size
	bl rand
	ldr r1, [r4, #DIFFICULTYENTRY_FIELD_LARGEASTEROIDCHANCE]
	cmp r0, r1
	movlo r0, #8
	blo asteroidSpawner_astSizeFound
	ldr r1, [r4, #DIFFICULTYENTRY_FIELD_MEDASTEROIDCHANCE]
	cmp r0, r1
	movlo r0, #7
	blo asteroidSpawner_astSizeFound
	mov r0, #6
asteroidSpawner_astSizeFound:
	strb r0, [r5, #ASTEROID_FIELD_SIZE]

	// use r6 to store the index of the skin into asteroidSkinArray
	sub r6, r0, #6

	// r0 = ???
	bl rand
	ldr r1, =SPECIAL_ASTEROID_CHANCE
	cmp r0, r1
	mov r0, #0
	movlo r0, #1
	addlo r6, r6, #3 // use r6 to store the index of the skin into asteroidSkinArray
	strb r0, [r5, #ASTEROID_FIELD_ISSPECIAL]

	ldr r0, =asteroidSkinArray
	ldr r0, [r0, r6, lsl #2]
	str r0, [r5, #COSTUMEDENTITY_FIELD_COSTUME]

	bl rand
	ldrsh r1, [r4, #DIFFICULTYENTRY_FIELD_BASEYVEL]
	asr r2, r1, #2
	umull r2, r3, r0, r2
	add r1, r1, r3
	strh r1, [r5, #ENTITY_FIELD_YVEL]

	ldr r0, =(-32 * 8)
	str r0, [r5, #ENTITY_FIELD_YPOS]

	// r6 = asteroid.xVel
	bl rand
	ldrsh r1, [r4, #DIFFICULTYENTRY_FIELD_RANGEXVEL]
	umull r2, r6, r0, r1 // r6 = magnitude of xVel
	tst r0, #0x80000000
	rsbne r6, r6, #0 // flip if the first bit is 1
	strh r6, [r5, #ENTITY_FIELD_XVEL]

	bl rand
	ldr r1, =(PIX_WIDTH * 8)
	umull r2, r3, r0, r1 // r3 = base xPos
	mov r0, #512
	smull r1, r2, r0, r6 // r2 = offset based on xVel
	add r3, r3, r2
	str r3, [r5, #ENTITY_FIELD_XPOS]

	pop {r4-r6, pc}
// end asteroidSpawner

/*
cometSpawner: either counts down a timer for the next comet spawn, or if the timer has just
run out, spawns a comet and sets up the next spawn. Comets are just asteroids with 1 health,
fixed spawn paths, and a lot more speed.

fn cometSpawner() {
	let static mut countdown = 1;

	countdown -= 1;
	if countdown > 0 {
		return;
	}

	countdown = difficulty.baseCometCountdown * (rand() as fixpt32_32);

	let comet = addSpace(asteroidBuff);
	comet.lifetime = 60;
	comet.originalHealth = difficulty.baseAsteroidHealth;
	comet.health = comet.originalHealth;
	comet.size = 6;
	let random = rand();
	let goingLeft = random & 0x80000000;
	comet.costume = if goingLeft { cometSkinLeft } else { cometSkinRight };
	comet.xPos = if goingLeft { (PIX_WIDTH + 32) * 8 } else { -32 * 8 };
	comet.yPos = (PIX_HEIGHT * 8 / 2) * (random as fixpt32_32);
	comet.yVel = difficulty.rangeXVel * 4;
	comet.xVel = difficulty.rangeXVel * 4 * if goingLeft { -1 } else { 1 };
	comet.isSpecial = false;
}
*/
cometSpawner_countdown:
	.word 1
cometSpawner:
	ldr r0, cometSpawner_countdown
	subs r0, r0, #1
	str r0, cometSpawner_countdown
	bxgt lr

	push {r4-r6, lr}

	// r4 = difficulty
	ldr r4, =difficulty
	ldr r4, [r4]

	bl rand // r0 = rand() as fixpt32_32
	ldr r1, [r4, #DIFFICULTYENTRY_FIELD_BASECOMETCOUNTDOWN] // r1 = baseCometCountdown
