	if
		(gameState == GameState::DeathScreen || gameState == GameState::StartScreen) &&
		keyboardState.space.changed && keyboardState.space.pressed
	{
		startGame();
	}
}
*/
processPlayerInput:
	push {r4-r5, lr}

	// r4 = keyboardState
	ldr r4, =keyboardState

	// r5 = ship
	ldr r5, =ship

	// ship.direction = (keyboardState.L.pressed as i32) - (keyboardState.J.pressed as i32);
	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_L]
	and r1, r1, #0x1
	ldrb r2, [r4, #KEYBOARDSTATE_INDEXOF_J]
	and r2, r2, #0x1
	sub r1, r1, r2
	strb r1, [r5, #SHIP_FIELD_DIRECTION]

	// r1 = xMove
	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_D]
	and r1, r1, #0x1
	ldrb r2, [r4, #KEYBOARDSTATE_INDEXOF_A]
	and r2, r2, #0x1
	sub r1, r1, r2

	// r2 = ship.xVel
	ldrsh r2, [r5, #ENTITY_FIELD_XVEL]

	// if xMove != 0
	cmp r1, #0 // TODO optimize out?
	beq processPlayerInput_dampenX

	add r2, r2, r1, lsl #4
	// r3 = ship.maxSpeed
	ldrsh r3, [r5, #SHIP_FIELD_MAXSPEED]
	cmp r2, r3
	bgt processPlayerInput_exceededMaxXVel
	rsb r3, r3, #0
	cmp r2, r3
	bge processPlayerInput_withinXVel
processPlayerInput_exceededMaxXVel:
	mov r2, r3
processPlayerInput_withinXVel:

	b processPlayerInput_xVelCalcsDone
processPlayerInput_dampenX:

	// r3 = -sign(ship.xVel);
	cmp r2, #0
	movlt r3, #3
	movgt r3, #-3
	moveq r3, #0

	add r2, r2, r3

processPlayerInput_xVelCalcsDone:
	// restore ship.xVel to memory
	strh r2, [r5, #ENTITY_FIELD_XVEL]

	// r1 = yMove
	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_S]
	and r1, r1, #0x1
	ldrb r2, [r4, #KEYBOARDSTATE_INDEXOF_W]
	and r2, r2, #0x1
	sub r1, r1, r2

	// r2 = ship.yVel
	ldrsh r2, [r5, #ENTITY_FIELD_YVEL]

	// if yMove != 0
	cmp r1, #0
	beq processPlayerInput_dampenY

	add r2, r2, r1, lsl #4
	// r3 = ship.maxSpeed
	ldrsh r3, [r5, #SHIP_FIELD_MAXSPEED]
	cmp r2, r3
	bgt processPlayerInput_exceededMaxYVel
	rsb r3, r3, #0
	cmp r2, r3
	bge processPlayerInput_withinMaxYVel
processPlayerInput_exceededMaxYVel:
	mov r2, r3
processPlayerInput_withinMaxYVel:

	b processPlayerInput_yVelCalcsDone
processPlayerInput_dampenY:

	// r3 = -sign(ship.yVel):
	cmp r2, #0
	movlt r3, #3
	movgt r3, #-3
	moveq r3, #0

	add r2, r2, r3

processPlayerInput_yVelCalcsDone:
	// restore ship.yVel to memory
	strh r2, [r5, #ENTITY_FIELD_YVEL]

	// fire bullet
	ldrsb r0, [r5, #SHIP_FIELD_CURRENTFIRECOOLDOWN]
	cmp r0, #0
	bgt processPlayerInput_noFire
	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_I]
	ands r1, r1, #1
	beq processPlayerInput_noFire
	ldrsb r0, [r5, #SHIP_FIELD_CURRENTFIRECOOLDOWN] // TODO optimize out?
	add r0, r0, #100
	strb r0, [r5, #SHIP_FIELD_CURRENTFIRECOOLDOWN]
	mov r0, r5
	bl spawnBullet
processPlayerInput_noFire:

	// spawn asteroid
	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_K]
	cmp r1, #3
	bleq spawnAsteroid

	// r3 = mineralBank, r2 = *mineralBank
	ldr r3, =mineralBank
	ldr r2, [r3]

	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_ONE]
	cmp r1, #3
	blt processPlayerInput_noUpgradeMaxHealth
	cmp r2, #UPGRADE_COST_MAXHEALTH
	blt processPlayerInput_noUpgradeMaxHealth
	sub r2, r2, #UPGRADE_COST_MAXHEALTH
	ldrsh r1, [r5, #SHIP_FIELD_MAXHEALTH]
	add r1, r1, #1
	strh r1, [r5, #SHIP_FIELD_MAXHEALTH]
processPlayerInput_noUpgradeMaxHealth:

	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_TWO]
	cmp r1, #3
	blt processPlayerInput_noUpgradeBulletSpeed
	cmp r2, #UPGRADE_COST_BULLETSPEED
	blt processPlayerInput_noUpgradeBulletSpeed
	sub r2, r2, #UPGRADE_COST_BULLETSPEED
	ldrsh r1, [r5, #SHIP_FIELD_BULLETSPEED]
	add r1, r1, #1
	strh r1, [r5, #SHIP_FIELD_BULLETSPEED]
processPlayerInput_noUpgradeBulletSpeed:

	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_THREE]
	cmp r1, #3
	blt processPlayerInput_noUpgradeBulletDamage
	cmp r2, #UPGRADE_COST_BULLETDAMAGE
	blt processPlayerInput_noUpgradeBulletDamage
	sub r2, r2, #UPGRADE_COST_BULLETDAMAGE
	ldrsh r1, [r5, #SHIP_FIELD_BULLETDAMAGE]
	add r1, r1, #1
	strh r1, [r5, #SHIP_FIELD_BULLETDAMAGE]
processPlayerInput_noUpgradeBulletDamage:

	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_FOUR]
	cmp r1, #3
	blt processPlayerInput_noUpgradeFireRate
	cmp r2, #UPGRADE_COST_FIRERATE
	blt processPlayerInput_noUpgradeFireRate
	sub r2, r2, #UPGRADE_COST_FIRERATE
	ldrsb r1, [r5, #SHIP_FIELD_FIRERATE]
	add r1, r1, #1
	strb r1, [r5, #SHIP_FIELD_FIRERATE]
processPlayerInput_noUpgradeFireRate:

	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_FIVE]
	cmp r1, #3
	blt processPlayerInput_noUpgradeMaxSpeed
	cmp r2, #UPGRADE_COST_MAXSPEED
	blt processPlayerInput_noUpgradeMaxSpeed
	sub r2, r2, #UPGRADE_COST_MAXSPEED
	ldrsh r1, [r5, #SHIP_FIELD_MAXSPEED]
	add r1, r1, #2
	strh r1, [r5, #SHIP_FIELD_MAXSPEED]
processPlayerInput_noUpgradeMaxSpeed:

	// restore *mineralBank to memory
	str r2, [r3]

	// start game
	ldrb r1, [r4, #KEYBOARDSTATE_INDEXOF_SPACE]
	cmp r1, #3
	bne processPlayerInput_noStart
	ldr r1, =gameState
	ldrb r1, [r1]
	cmp r1, #GAMESTATE_VARIANT_STARTSCREEN
	bhi processPlayerInput_noStart
	bl startGame
processPlayerInput_noStart:

	pop {r4-r5, pc}
// end processPlayerInput

