	cmp r0, #0
	beq destroyAsteroid_splitSpecialDone

	bl rand
	lsrs r0, r0, #31
	addne r7, r7, #3
	addeq r6, r6, #3
	beq destroyAsteroid_splitSpecialDone

	// r0 must be equal to 1 at this point
	strb r0, [r5, #ASTEROID_FIELD_ISSPECIAL]
	mov r0, #0
	strb r0, [r4, #ASTEROID_FIELD_ISSPECIAL]

destroyAsteroid_splitSpecialDone:

	ldr r0, =asteroidSkinArray
	ldr r1, [r0, r6, lsl #2]
	str r1, [r4, #COSTUMEDENTITY_FIELD_COSTUME]
	ldr r1, [r0, r7, lsl #2]
	str r1, [r5, #COSTUMEDENTITY_FIELD_COSTUME]

destroyAsteroid_done:

	pop {r4-r7, pc}
